import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import { BrowserRouter as Router, Route } from 'react-router-dom';

export default class Navbar extends Component {
    render() {
        return (
            <nav className="navbar navbar-expand-lg navbar-dark bg-dark " id="mainNav">
            <Link to="/" className="navbar-brand"><a class="navbar-brand" href="../excer-logo.ico"></a>ExcerTracker</Link>
            <div className="container">
                <a className="navbar-brand js-scroll-trigger" href="#page-top">Start Bootstrap</a>
                <button className="navbar-toggler navbar-toggler-right" type="button" data-toggle="collapse" data-target="#navbarResponsive" aria-controls="navbarResponsive" aria-expanded="false" aria-label="Toggle navigation">
                    Menu
                    <i className="fas fa-bars"></i>
                </button>
                <div className="collapse navbar-collapse" id="navbarResponsive">
                    <ul className="navbar-nav ml-auto">
                        <li className="navbar-item">
                            <Link to="/" className="nav-link js-scroll-trigger">Exercises</Link>
                        </li>
                        <li className="navbar-item">
                            <Link to="/create" className="nav-link">Create Exercise Log</Link>
                        </li>
                        <li className="navbar-item">
                            <Link to="/user" className="nav-link">Create User</Link>
                        </li>
                        <li className="navbar-item">
                            <Link to="/recommendation" className="nav-link">Recommended Exercises</Link>
                        </li>
                    </ul>
                </div>
            </div>
            </nav>
            // <header className="masthead">
            //     <div class="container d-flex h-100 align-items-center">
            //         <div class="mx-auto text-center">
            //             <h1 class="mx-auto my-0 text-uppercase">Grayscale</h1>
            //             <h2 class="text-white-50 mx-auto mt-2 mb-5">A free, responsive, one page Bootstrap theme created by Start Bootstrap.</h2>
            //             <a class="btn btn-primary js-scroll-trigger" href="#about">Get Started</a>
            //         </div>
            //     </div>
            // </header>

            // <nav className="navbar navbar-dark bg-dark navbar-expand-lg">
            //     <Link to="/" className="navbar-brand">ExcerTracker</Link>
            //     <div className="collapse navbar-collapse">
            //     <ul className="navbar-nav mr-auto">
            //         <li className="navbar-item">
            //             <Link to="/" className="nav-link">Exercises</Link>
            //         </li>
            //         <li className="navbar-item">
            //             <Link to="/create" className="nav-link">Create Exercise Log</Link>
            //         </li>
            //         <li className="navbar-item">
            //             <Link to="/user" className="nav-link">Create User</Link>
            //         </li>
            //         <li className="navbar-item">
            //             <Link to="/recommendation" className="nav-link">Recommended Exercises</Link>
            //         </li>
            //     </ul>
            //     </div>
            // </nav>
        );
    }
}
